const gyminputformStyle = theme => ({
    paper: {
        display: "flex",
        flexWrap: "wrap",
        flexDirection: "row",
        justifyContent: "flex-start",
        [theme.breakpoints.up("sm")]: {         
            marginLeft: "1rem"
        }
    },
    select: {
        display: "flex",
        flexWrap: "wrap",
        justifyContent: "center",
        flexDirection: "column",
    },
    datepicker: {
        fontSize: "1.5rem"
    }
});

export default gyminputformStyle;
